function CreateGrid() {
  const gridContainer = document.createElement("div");
  gridContainer.id = "grid-container";
  for (let w = 4; w < 41; w++) {
    const cell = document.createElement("div");
    cell.id = w;
    gridContainer.appendChild(cell);
  }
  return gridContainer;
}
const Home = () => {
  return (
    <div>
      <CreateGrid />
    </div>
  );
};

export default Home;
